    return (
        <section id = "about" className="about">
            <PageHeaderContent
                headerText="About Me"
                icon={<BsInfoCircleFill size={40}/>}
            />
            <div className="about__content">
                <h3>
                    Full Stack Developer
                </h3>
                <p>{jobsummary}</p>

            </div>
        </section>
    );
};
export default About;
